import React, { useState } from "react";
import WithCard from "components/container/withCard";
import { fetchUsers } from "api/db-init";
import { Button } from "semantic-ui-react";

type Props = {
  env: string;
};

const Saved = async (props: Props) => {
  const [users, setUsers] = useState<[] | Promise<Element>>(["berk", "akgün"]);
  setUsers(await fetchUsers(props.env));
  return (
    <div>
      {users ? (
        users.map(() => <WithCard />)
      ) : (
        <React.Fragment>
          <h1>There is no saved user</h1>
          <Button color="green">Go to Home</Button>
        </React.Fragment>
      )}
    </div>
  );
};

export default Saved;
